import React from 'react';

class Zerodha extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="container">
                <div className="text-center">
                    <img src="https://zerodha.com/static/images/landing.png"></img>
                    <h1 className="display-4">Invest in everything</h1>
                    <h5 className="font-weight-light">Online platform to invest in stocks, derivatives, mutual funds, and more</h5>
                    <button className="my-3" style={{ width: "200px" }} id="zerodha-btn">Sign up now</button>
                </div>

            </div>
        )
    }
}


export default Zerodha
